  <style>body{font-family:Arial,sans-serif;background-color:#d1d1d1;margin:0;padding:0;display:flex;justify-content:center;align-items:center}.container{width:100%;max-width:500px;background:#fff;padding:30px;border-radius:10px;box-shadow:0 4px 8px rgba(0,0,0,.1)}</style>

<body>
    <div class="container">
        <div class="panel panel-default">
            <div class="panel-heading" style="text-align: center;"><b>Form Data Reservasi</b></div>
            <div class="panel-body">
                <div class="form-group" style="text-align: center;">
                    <form id="reservationForm">
                        <label class="control-label" for="reservationType">Pilih Ujian:</label>
                        <select id="reservationType" class="form-control" required>
                            <option value="">Pilih Ujian</option>
                            <option value="JFT">JFT</option>
                            <option value="PM">PM</option>
                            <option value="Restoran">Restoran</option>
                            <option value="Kaigo Indonesia">Kaigo Indonesia</option>
                            <option value="Kaigo Jepang">Kaigo Jepang</option>
                            <option value="Pertanian">Pertanian</option>
                            <option value="Peternakan">Peternakan</option>
                        </select>
                        <br>
                        <div id="formFields" style="display: none;">
                            <label class="control-label">Jenis Tes:</label>
                            <input type="text" id="jenisTes" class="form-control" readonly required>
                            <br>
                            <label class="control-label">Nama Lengkap:</label>
                            <input type="text" id="nama" class="form-control" required>
                            <br>
                            <label class="control-label">ID Prometric:</label>
                            <input type="text" id="id" class="form-control" maxlength="9" required>
                            <br>
                            <label class="control-label">Password:</label>
                            <input type="text" id="password" class="form-control" required>
                            <br>
                            <label class="control-label">Tanggal Lahir:</label>
                            <input type="date" id="ttl" class="form-control" required>
                            <br>
                            <label class="control-label">Jenis Kelamin:</label>
                            <select id="gender" class="form-control" required>
                                <option value="Laki-laki">Laki-laki</option>
                                <option value="Perempuan">Perempuan</option>
                            </select>
                            <br>
                            <label class="control-label">Tanggal Ujian:</label>
                            <br>
                            <div class="form-inline">
                                <input type="date" id="sExam" class="form-control" required>
                                <label class="control-label" style="margin: 0 10px;">s/d</label>
                                <input type="date" id="eExam" class="form-control" required>
                            </div>
                            <br>
                            <label class="control-label">Tempat Ujian:</label>
                            <input type="text" id="lokasi" class="form-control" required>
                            <br>
                            <label class="control-label">No OVO (isi jika pakai OVO pribadi)</label>
                            <input type="number" id="ovo" class="form-control">
                            <br><br>
                            <button class="btn btn-md btn-success" type="button" id="submitBtn">Kirim</button>
                        </div>
                    </form>
                </div>
            </div>
        </div>
    </div>
